import * as React from "react";
import Box from "@mui/material/Box";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import Button from "@mui/material/Button";
import Typography from "@mui/material/Typography";
import { Divider } from "@mui/material";

const bull = (
  <Box
    component="span"
    sx={{ display: "inline-block", mx: "2px", transform: "scale(0.8)" }}
  >
    •
  </Box>
);

const card = (
  <React.Fragment>
    <CardContent>
      <Typography
        sx={{
          position: "absolute",
          left: "17.08%",
          right: "66.76%",
          top: "70.56%",
          bottom: "27.44%",
          fontFamily: "Libre Baskerville",
          fontStyle: "normal",
          fontWeight: 700,
          fontSize: "14px",
          lineHeight: "132%",
          display: "flex",
          alignItems: "center",
          letterSpacing: "2px",
          textTransform: "uppercase",
          color: " #000",
          opacity: "0.6",
        }}
        color="text.secondary"
        gutterBottom
      >
        Qui suis-je ?
      </Typography>
      <Divider
        sx={{
          position: "absolute",
          left: "24.44%",
          right: "71.6%",
          top: "74.56%",
          bottom: "25.22%",
          color: "#0000",
        }}
      />
      <Typography
        sx={{
        //   position: "absolute",
        //   width: "176px",
        //   height: "36px",
        //   left: "287px",
        //   top: "690px",

          fontFamily: "Montserrat",
          fontStyle: "normal",
          fontWeight: 500,
        //   fontSize: "9px",
        //   lineHeight: "132%",

        //   display: "flex",
        //   alignItems: "center",
        //   textAlign: "center",
        //   letterSpacing: "1px",
        //   textTransform: "lowercase",
        //   color: "#0000",
        }}
      >
        je m’appelle Maxime et je me lance dans la création d’un magasin de vélo
      </Typography>
    </CardContent>
  </React.Fragment>
);

export default function Cards() {
  return (
    <Box
      sx={{
        position: "absolute",
        width: "300px",
        height: "138px",
        left: "230px",
        top: "619px",
      }}
    >
      <Card variant="outlined">{card}</Card>
    </Box>
  );
}
